	(1, 'La Fiesta de las Flores y Frutas', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d63821.72750961226!2d-78.66281860515562!3d-1.2571432750911071!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381a37fef551f%3A0x7a2dbc24d832161b!2sAmbato!5e0!3m2!1ses-419!2sec!4v1709582065578!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Ambato tiene una variada agenda para este feriado de Carvanal. Ya el fin de semana empezó con un pregón y la elección de su reina. Entre los programas importantes que se desarrollarán está para el sábado 18 la bendición de las flores, frutas y pan en el atrio de la Catedral. ');

