INSERT INTO `iglesias` (`id`, `nombre`, `imagen`, `ubicacion`, `descripcion`) VALUES
	(1, 'Catedral de Ambato', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.881375967076!2d-78.63136588911358!3d-1.2417279987412126!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381be9b876133%3A0x3574cb213cbe0c40!2sBas%C3%ADlica%20Catedral%20de%20Nuestra%20Se%C3%B1ora%20de%20la%20Elevaci%C3%B3n!5e0!3m2!1ses-419!2sec!4v1707446465172!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Monumental edificio religioso de estilo neoclásico, construido en el siglo XIX, que destaca por su imponente arquitectura y su importancia histórica en la ciudad.'),
	(2, 'Basílica de la Merced', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3875.3315972861765!2d-78.62716193802783!3d-1.2377489039681937!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381b00eea3fc1%3A0x39ea7767f58ac20e!2sIglesia%20Cat%C3%B3lica%20La%20Merced%20%7C%20Ambato!5e0!3m2!1ses!2sec!4v1707446565247!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Iglesia colonial con una fachada barroca adornada, alberga una rica colección de arte sacro y es reconocida por su papel devocional en la comunidad ambateña.'),
	(3, 'Iglesia de la Medalla Milagrosa', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1617.6531335176146!2d-78.62925917429283!3d-1.2392457971103126!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381bbe897d00d%3A0xbffe6d6bcb45d73f!2sIglesia%20Cat%C3%B3lica%20de%20La%20Medalla%20Milagrosa!5e0!3m2!1ses!2sec!4v1707446592052!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Moderna estructura dedicada a la Virgen María, conocida por su diseño contemporáneo y su vibrante vida parroquial, siendo un centro de encuentro y oración para los fieles locales.');

