-- Volcando datos para la tabla ambatolugaresdb.museos: ~7 rows (aproximadamente)
INSERT INTO `museos` (`id`, `nombre`, `imagen`, `ubicacion`, `descripcion`) VALUES
	(1, 'Pictórico Edmundo Martínez', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.879233418099!2d-78.63397092503443!3d-1.2431469987450032!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381bfad50e1c9%3A0x8ce441a673c016fd!2sMuseo%20L.%20Edmundo%20Mart%C3%ACnez%20Mera!5e0!3m2!1ses-419!2sec!4v1707535516058!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Un espacio rodeado de sensaciones multicolores, que despiertan el interés por el arte plástico de exponentes nacionales e internacionales. Es un refugio artístico del salón nacional Luis A. Martínez, uno de los más importantes del Ecuador.'),
	(2, 'Juan Benigno Vela', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.881425462917!2d-78.63301012503446!3d-1.2416951987464706!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381bee973444d%3A0x72a0f0311a81f03f!2sMuseo%20Juan%20Benigno%20Vela!5e0!3m2!1ses!2sec!4v1707535491256!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Sitio patrimonial para aprender del espíritu luchador del tercer Juan de Ambato: Don Juan Benigno Vela, quien fue conocido por portar la pluma de la libertad, y en el corazón el amor por el pueblo ecuatoriano. Fue el promotor del periodismo en la provincia y destacado político de los siglos XIX y XX.'),
	(3, 'Centro Cultural Pachano Lalama', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.8835870763533!2d-78.6297211524349!3d-1.240261889642258!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381beb2baf5dd%3A0x54e51e97f1b3d255!2sCentro%20Cultural%20Pachano%20Lalama!5e0!3m2!1ses-419!2sec!4v1707535575823!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Hogar de una familia de intelectuales, uno de ellos Rodrigo Pachano, escritor de la letra del Himno a la provincia de Tungurahua. Su letra denota el fervor y la altivez del orgullo tungurahuense, describiendo la fuerza de nuestros volcanes, la belleza de nuestros paisajes y la hidalguía de la tierra de los Juanes.'),
	(5, 'Quinta de Montalvo', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.867590517785!2d-78.6487483891136!3d-1.2508298987319895!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381e591e2097b%3A0xc0bae6377b237d4e!2sQuinta%20de%20Juan%20Montalvo!5e0!3m2!1ses-419!2sec!4v1707535655817!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Entre majestuosos árboles frutales y especies patrimoniales se encuentra la Quinta de Juan Montalvo, con una casa de estilo clásico rural, donde se exhiben piezas originales que narran el pensamiento altivo por la justicia y la libertad para el pueblo ecuatoriano.'),
	(6, 'Casa museo Martínez – Holguín', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.9020491837296!2d-78.62443188911368!3d-1.227951998755165!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381ad129592c9%3A0x1073d0ccaf44ccf3!2sCasa%20Museo%20Mart%C3%ADnez-Holgu%C3%ADn!5e0!3m2!1ses-419!2sec!4v1707535699801!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'En el siglo XIX acogió a una familia intelectual, donde nació Luis A. Martínez, escritor de la novela “A la Costa”, quien refundó la escuela de Bellas Artes del Ecuador. También nació en este sitio Augusto Martínez, destacado científico promotor de la 2da misión geodésica francesa, y estudioso de la botánica de Ecuador continental.'),
	(7, 'Casa museo Juan León Mera', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.900284436888!2d-78.62667208911363!3d-1.2291339987539585!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381b2682bee37%3A0x46c492b17c101453!2sQuinta%20de%20Juan%20Le%C3%B3n%20Mera!5e0!3m2!1ses-419!2sec!4v1707535740021!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Recrea el hogar donde vivió el autor de la letra del Himno Nacional del Ecuador, escrita la noche del 26 de noviembre de 1865, en cada una de las salas se podrá apreciar las distintas facetas de Mera: escritor, pintor, políglota y político.');
INSERT INTO `museos` (`id`, `nombre`, `imagen`, `ubicacion`, `descripcion`) VALUES
	(8, 'Centro Cultural Etnográfico Museo de Pasa', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.8426256317302!2d-78.73464108911358!3d-1.2671466987154574!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d3794c5d3ec82b%3A0x9b61f8a212ceab10!2sMuseo%20De%20Pasa!5e0!3m2!1ses-419!2sec!4v1707535789065!5m2!1ses-419!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Resalta la vida y tradiciones de este sector rural de la ciudad de Ambato. Se destaca la confección de camisas, actividad que se desarrolla por más de 100 años. Así también se exalta la vida agrícola que caracteriza a la hermosa parroquia de Pasa.');

